# @lc app=leetcode.cn id=4 lang=python3
#
# [4] 寻找两个正序数组的中位数
#

# @lc code=start
class Solution:
    class Nums():
        def __init__(self, values):
            self.values = values
            self.left = 0
            self.right = len(values)
            self.mid = (self.left + self.right - 1) // 2
            self.hide = 0
            self.keep_odd()

        def keep_odd(self):
            if len(self) % 2 == 0:
                self.hide = self.hide * 2 + 1
                self.right -= 1
            self.mid = (self.left + self.right - 1) // 2
            
        def mid_value(self):
            return self.values[self.mid]

        def select_right(self):
            self.left = self.mid
            self.keep_odd()

        def select_left(self):
            self.right = self.mid + 1
            self.keep_odd()

        def width(self):
            return self.right - self.left

        def __len__(self):
            return self.right - self.left

        def get_candidates(self):
            right = self.right + self.hide
            left = max(self.left - 1, 0)
            return left, self.values[left:right+1]

    def findMedianSortedArrays(self, nums1: List[int], nums2: List[int]) -> float:
        n1 = Solution.Nums(nums1)
        n2 = Solution.Nums(nums2)

        while n1.width() > 1 and n2.width() > 1:
            mid1 = n1.mid_value()
            mid2 = n2.mid_value()
            if mid1 < mid2:
                n1.select_right()
                n2.select_left()
            else:
                n1.select_left()
                n2.select_right()
        left1, candidates1 = n1.get_candidates()
        left2, candidates2 = n2.get_candidates()
        candidates = sorted(candidates1 + candidates2)
        total = len(nums1) + len(nums2)
        target1 = total // 2
        target2 = target1 - 1 if total % 2 == 0 else target1
        target1 -= left1 + left2
        target2 -= left1 + left2
        return (candidates[target1] + candidates[target2]) / 2.0


